import './App.css';

function RenderName(props){
  return(
    <>
      <h1>Name: {props.firstName}</h1>
      <h2>Last Name: {props.lastName}</h2>
      <h3>Age: {props.age}</h3>
    </>
  )
}

function App() {

  return (
    <div className="App">
      <RenderName
        firstName = 'Priaysnhu'
        lastName = 'Katiyar'
        age = {20+1}
      />
      <RenderName
        firstName = 'Himanshu'
        lastName = 'Katiyar'
        age = {24+1}
      />
    </div>
  );
}

export default App;
